import React, { Component } from 'react';
import  { Redirect } from 'react-router-dom';


class Home extends Component {
    constructor() {
        super();
        this.state = {
            value: ''
        };
        this.loggedin = false;
    }

	handleLogout() {
		console.log("logout");
		return <Redirect to={{
            pathname: '/login',
            }} />
    }

  	render() {
    	return (
	    	<div className="Home">
	    		<button style={{float: 'right'}}onClick={this.handleLogout}>Log Out</button>
	        	<h1>Home</h1>
	        	<p>Welcome to your fridge (user)</p>
	    	</div>
    	);
    }
}

export default Home;
